def calculate_additional_works_needed(n, cubes):
    D = [(1, 5, 2, 3, 0, 4), (3, 1, 0, 5, 4, 2), (4, 0, 2, 3, 5, 1), (2, 1, 5, 0, 4, 3)]
    p_dice = (0, 0, 0, 1, 1, 2, 2, 3) / 3

    def rotate_dice(L0):
        L = L0[:]
        for k in p_dice:
            yield L
            L[:] = (L[e] for e in D[k])
    res = []
    for cube in cubes:
        cube_colors = cube.split()
        for dice in rotate_dice(cube_colors):
            if dice in res:
                break
        else:
            res.append(cube_colors)
    return n - len(res)

